import React from "react";
import "./Signup.css";
import { Link } from "react-router-dom";
import Input from "../components/Input";

const Signup = () => {
  return (
    <div className="Signup">
      <h1> Sign Up</h1>
      <Link className="Link" to="/">
        <h2> Login</h2>
      </Link>

      <div className="flex">
        <div className="in">
          <Input />
        </div>
        <div className="put">
          <Input />
        </div>
      </div>

      <Input />
      <Input />
      <Input />
    </div>
  );
};

export default Signup;
